```


:::
:::


Objective: Create a data frame with two columns

1. source: artist
2. target: song

## rbind


::: {.cell}

```{.r .cell-code}
df1 <- music_df |>
  select(artist1, song1) |>
  set_names(c("artist", "song"))
df2 <- music_df |>
  select(artist2, song2) |>
  set_names(c("artist", "song"))

music_long <- df1 |>
  rbind(df2) |>
  separate_longer_delim(artist, delim = ", ") |>
  filter(!is.na(artist)) |>
  filter(!is.na(song))
```
:::


## top_n

Who are the top 5 most frequent artists in the data set?


::: {.cell}

```{.r .cell-code}
music_long |>
  count(artist) |>
  arrange(desc(n)) |>
  top_n(5, wt = n)
```

