                  label = majors_df$major,
                  color = "#E77500",
                  shape = "circle") |>
  bind_rows(
    tibble(id = majors_df$minor1,
           label = majors_df$minor1,
           color = "#121212",
           opacity = 0.5,
           shape = "circle")
  ) |> 
  bind_rows(
    tibble(id = majors_df$minor2,
           label = majors_df$minor2,
           color = "#121212",
           opacity = 0.5,
           shape = "circle")
